const styles = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  border: '2px solid',
  width: '100%',
  height: '40px',
  borderRadius: '5px',
  color: 'white',
  fontSize: '1.3rem',
}

const marginSpan1 = {
  marginLeft: '10px'
}

const marginSpan2 = {
  width: '15px',
  marginRight: '10px',
  borderRadius: '10px',
  border: 'white solid 1px'
}

function TodoItem({ text, completed }){
    return(
      <li style={styles}>
        <span style={marginSpan1}>V</span>
        <p>{text}</p>
        <span style={marginSpan2}>X</span>
      </li>
    )
}

export default TodoItem
